import cT from "./create-tile";

const initializeBoard = (): any => {
  return [
    [
      cT(false, ["a", 8]),
      cT(true,  ["b", 8]),
      cT(false, ["b", 8]),
      cT(true,  ["d", 8]),
      cT(false, ["e", 8]),
      cT(true,  ["f", 8]),
      cT(false, ["g", 8]),
      cT(true,  ["h", 8])
    ],
    [
      cT(true,  ["a", 7]),
      cT(false, ["b", 7]),
      cT(true,  ["c", 7]),
      cT(false, ["d", 7]),
      cT(true,  ["e", 7]),
      cT(false, ["f", 7]),
      cT(true,  ["g", 7]),
      cT(false, ["h", 7])
    ],
  ]
};

export default initializeBoard;
